import{_ as e,o as i,c as t,O as o}from"./chunks/framework.9482e208.js";const y=JSON.parse('{"title":"§ 13.1-1094 Rules for applying other articles of this chapter to specified provisions of this article.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-1094.md","filePath":"vacode/13.1-1094.md"}'),s={name:"vacode/13.1-1094.md"},a=o('<h1 id="§-13-1-1094-rules-for-applying-other-articles-of-this-chapter-to-specified-provisions-of-this-article" tabindex="-1">§ 13.1-1094 Rules for applying other articles of this chapter to specified provisions of this article. <a class="header-anchor" href="#§-13-1-1094-rules-for-applying-other-articles-of-this-chapter-to-specified-provisions-of-this-article" aria-label="Permalink to &quot;§ 13.1-1094 Rules for applying other articles of this chapter to specified provisions of this article.&quot;">​</a></h1><p>A. Except as otherwise provided in subsection B and § <a href="/vacode/13.1-1093/">13.1-1093</a>, the following rules apply in applying § <a href="/vacode/13.1-1092/">13.1-1092</a>, subsections C and F of § <a href="/vacode/13.1-1099.5/">13.1-1099.5</a>, subdivision 4 a of § <a href="/vacode/13.1-1099.11/">13.1-1099.11</a>, subsection A of § <a href="/vacode/13.1-1099.12/">13.1-1099.12</a>, and subdivision 2 of § <a href="/vacode/13.1-1099.13/">13.1-1099.13</a>:</p><ol><li><p>A protected series of a series limited liability company is deemed to be a limited liability company that is organized separately from the series limited liability company and distinct from the series limited liability company and any other protected series of the series limited liability company;</p></li><li><p>An associated member of the protected series is deemed to be a member of the series limited liability company;</p></li><li><p>A protected series assignee of the protected series is deemed to be an assignee of the series limited liability company;</p></li><li><p>A protected series membership interest of the protected series is deemed to be a membership interest of the series limited liability company;</p></li><li><p>A protected series manager is deemed to be a manager of the series limited liability company;</p></li><li><p>An asset of the protected series is deemed to be an asset of the series limited liability company, whether or not the asset is an associated asset of the protected series; and</p></li><li><p>Any creditor or other obligee of the protected series is deemed to be a creditor or obligee of the series limited liability company.</p></li></ol><p>B. Subsection A does not apply if its application would:</p><ol><li><p>Vary § <a href="/vacode/13.1-1023/">13.1-1023</a>, subsection B or C of § <a href="/vacode/13.1-1092/">13.1-1092</a>, or § <a href="/vacode/13.1-1093/">13.1-1093</a>; or</p></li><li><p>Require the Commission to:</p></li></ol><p>a. Accept for filing a type of record that this chapter expressly does not authorize or require a person to deliver to the Commission for filing; or</p><p>b. Make or deliver a record that neither this article nor any other provision of this chapter authorizes or requires the Commission to make or deliver.</p><p>2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0636" target="_blank" rel="noreferrer">636</a>.</p>',8),r=[a];function l(p,c,d,n,h,f){return i(),t("div",null,r)}const b=e(s,[["render",l]]);export{y as __pageData,b as default};
